def build_url(month, city):
    city_code = city_dict[city]
    url = "http://tianqi.2345.com/t/wea_history/js/" + month + "/" + city_code + "_" + month + ".js"
    return url

def get_next_month(month):
    date_time = datetime.datetime.strptime(month, '%Y%m')
    year = date_time.year
    month = date_time.month
    if month == 12:
        month = 1
        year += 1
    else:
        month += 1
    return datetime.datetime(year,month,1).strftime('%Y%m')

def get_need_months(start_month, end_month=datetime.datetime.today().strftime('%Y%m')):
    months = []
    while start_month <= end_month:
        months.append(start_month)
        start_month = get_next_month(start_month)
    return months

def process_html_str(json_str):
    # 处理....
    json_str = json_str.replace(":\'", ":")
    json_str = json_str.replace("\',", ",")
    json_str = json_str.replace("\'}", "}")
    json_str = json_str.replace("{", "{\"")
    json_str = json_str.replace(":", "\":\"")
    json_str = json_str.replace(",", "\",\"")
    json_str = json_str.replace("}", "\"}")
    json_str = json_str.replace("\"[", "[")
    json_str = json_str.replace("]\"", "]")
    json_str = json_str.replace("\"{", "{")
    json_str = json_str.replace("}\"", "}")
    json_str = json_str.replace(",{\"\"}", "")
    return json_str

def get_city_weather_of_one_day(one_day):
    # city = decode_json['city']
    date = one_day['ymd']
    bWendu = (one_day['bWendu'])[:-1]  # 最高温度
    yWendu = (one_day['yWendu'])[:-1]  # 最低温度
    tianqi = one_day['tianqi']
    fengxiang = one_day['fengxiang']
    fengli = one_day['fengli']
    aqi = one_day['aqi']
    aqiInfo = one_day['aqiInfo']
    aqiLevel = one_day['aqiLevel']
    return pd.DataFrame({'date':[date], 'city':[''],'bWendu':[bWendu],
                         'yWendu':[yWendu],'tianqi':[tianqi],'fengxiang':[fengxiang],
                         'fengli':[fengli],'aqi':[aqi],'aqiInfo':[aqiInfo],'aqiLevel':[aqiLevel]})

